export const getMacroNutrientsFromSelectedFoods = state => {
  const macroNutrients = {
    calories: 0,
    caloriesUnits: 'kcal',
    caloriesInUnits: 0,
    proteins: 0,
    proteinUnits: 'μg',
    proteinsInUnits: 0,
