    fatUnits: 'μg',
    fatInUnits: 0
  }
  Object.keys(state.selectedFoods).forEach(selectedFoodName => {
    macroNutrients.calories += state.selectedFoods[selectedFoodName].calories * state.selectedFoods[selectedFoodName].grams;
    macroNutrients.proteins += state.selectedFoods[selectedFoodName].proteins * state.selectedFoods[selectedFoodName].grams;
    macroNutrients.carbohydrates += state.selectedFoods[selectedFoodName].carbohydrates * state.selectedFoods[selectedFoodName].grams;
    macroNutrients.fat += state.selectedFoods[selectedFoodName].fat * state.selectedFoods[selectedFoodName].grams;
  })
  macroNutrients.caloriesInUnits = macroNutrients.calories;
  macroNutrients.proteinsInUnits = macroNutrients.proteins;
  macroNutrients.carbohydratesInUnits = macroNutrients.carbohydrates;
  macroNutrients.fatInUnits = macroNutrients.fat;
  if (macroNutrients.proteinsInUnits >= 1000) {
    macroNutrients.proteinsInUnits /= 1000;
    macroNutrients.proteinUnits = 'mg'
  }
  if (macroNutrients.proteinsInUnits >= 1000) {
    macroNutrients.proteinsInUnits /= 1000;
    macroNutrients.proteinUnits = 'g'
  }
  if (macroNutrients.carbohydratesInUnits >= 1000) {
    macroNutrients.carbohydratesInUnits /= 1000;
    macroNutrients.carbohydratesUnits = 'mg'
  }
  if (macroNutrients.carbohydratesInUnits >= 1000) {
    macroNutrients.carbohydratesInUnits /= 1000;
    macroNutrients.carbohydratesUnits = 'g'
  }
  if (macroNutrients.fatInUnits >= 1000) {
    macroNutrients.fatInUnits /= 1000;
    macroNutrients.fatUnits = 'mg'
  }
  if (macroNutrients.fatInUnits >= 1000) {
    macroNutrients.fatInUnits /= 1000;
    macroNutrients.fatUnits = 'g'
  }
  return macroNutrients
}

export const getNutrientsFromSelectedFoods = state => {
  const nutrients = {};
  Object.keys(state.nutrients).forEach(nutrient => {
    nutrients[nutrient] = {
      ...state.nutrients[nutrient],
      amount: 0,
      percentage: 0,
      status: undefined
    };
    Object.keys(state.selectedFoods).forEach(selectedFoodName => {
      const selectedFood = state.selectedFoods[selectedFoodName]
      const foodNutrients = selectedFood.nutrients[nutrient];
      if (typeof foodNutrients === 'undefined') {
        console.log(`Food ${selectedFood.name} is missing nutrient: ${nutrient}`);
      }
      nutrients[nutrient].amount += (foodNutrients || 0) * selectedFood.grams;

      return nutrients;
    })
    nutrients[nutrient].percentage = parseInt((nutrients[nutrient].amount * 100) / nutrients[nutrient].rda, 10)
    nutrients[nutrient].amount = parseInt(nutrients[nutrient].amount, 10)
    nutrients[nutrient].amountInUnits = nutrients[nutrient].amount
    nutrients[nutrient].amountUnit = 'μg'
    if (nutrients[nutrient].amountInUnits >= 1000) {
      nutrients[nutrient].amountInUnits /= 1000;
      nutrients[nutrient].amountUnit = 'mg'
    }
    if (nutrients[nutrient].amountInUnits >= 1000) {
      nutrients[nutrient].amountInUnits /= 1000;
      nutrients[nutrient].amountUnit = 'g'
    }
  })
  return nutrients;
}




