import Vue from 'vue'
import Vuex from 'vuex'
import * as actions from './actions'
import * as getters from './getters'

Vue.use(Vuex)

const state = {
  foods: [],
  nutrients: {},
  selectedFoods: {},
  topics: [],
  count: 0
}

const mutations = {

  FOOD_SELECTED: (state, selectedFoodName) => {
    Vue.set(state.selectedFoods, selectedFoodName, {
      ...state.foods[selectedFoodName],
      grams: state.foods[selectedFoodName].serving || 100
    })
  },

  FOOD_GRAMS_CHANGED: (state, foodUpdate) => {
    console.log(state.selectedFoods[foodUpdate.foodName], 'grams', foodUpdate.grams);
    Vue.set(state.selectedFoods[foodUpdate.name], 'grams', foodUpdate.grams);
  },

  FOOD_REMOVED: (state, foodName) => {
    // delete state.selectedFoods[foodName];
    Vue.delete(state.selectedFoods, foodName);
  },

  FOODS_LOADED: (state, foods) => {
    state.foods = foods
  },
  NUTRIENTS_LOADED: (state, nutrients) => {
    state.nutrients = nutrients
  }
}

export default function () {
  return new Vuex.Store({
    state,
    actions,
    mutations,
    getters
  })
}



